import React, {Component, Fragment} from 'react';
import {Col, Container, Row} from "react-bootstrap";

class Video extends Component {
    render() {
        return (
            <Fragment>
                <Container>
                    <h1>How DO I</h1>
                    <Row>
                        <Col lg={12} md={12} sm={12} className="videoCard">
                            <div>


                            </div>


                        </Col>

                    </Row>


                </Container>


            </Fragment>
        );
    }
}

export default Video;
